INSERT INTO `faqs` VALUES (1,'What documents do I need to buy a property in the Dominican Republic?','You will need your ID card or passport (if you\'re a foreigner), proof of funds or financing approval, and a notarized purchase agreement.','{\"answer_en\": \"To buy a property in the Dominican Republic, you will need a valid passport or identification card...\", \"answer_es\": \"Para comprar una propiedad en la Repblica Dominicana, necesitar un pasaporte vlido o tarjeta de identificacin...\", \"question_en\": \"What documents do I need to buy a property in the Dominican Republic?\", \"question_es\": \"Qu documentos necesito para comprar una propiedad en la Repblica Dominicana?\"}',1,'2024-12-20 19:22:04','2024-12-20 19:22:04',NULL),(2,'Are there restrictions for foreigners buying property in the Dominican Republic?','No, foreigners can purchase properties freely and have the same legal rights as Dominican citizens.','{\"answer_en\": \"Foreigners can freely buy properties in the Dominican Republic...\", \"answer_es\": \"Los extranjeros pueden comprar propiedades libremente en la Repblica Dominicana...\", \"question_en\": \"Are there restrictions for foreigners buying property in the Dominican Republic?\", \"question_es\": \"Hay restricciones para que los extranjeros compren propiedades en la Repblica Dominicana?\"}',1,'2024-12-20 19:24:11','2024-12-20 19:24:11',NULL),(3,'What taxes do I have to pay when buying a property?','You must pay a Transfer Tax equivalent to 3% of the registered property value. Additionally, an annual property tax (IPI) applies to properties valued over RD$7,710,158.','{\"answer_en\": \"The main taxes include transfer tax (3%), registration fee, and legal fees...\", \"answer_es\": \"Los impuestos principales incluyen impuesto de transferencia (3%), tarifa de registro, y honorarios legales...\", \"question_en\": \"What taxes do I have to pay when buying a property?\", \"question_es\": \"Qu impuestos tengo que pagar al comprar una propiedad?\"}',1,'2024-12-20 19:25:41','2024-12-20 19:25:41',NULL),(4,'How is the property Im buying secured?','All properties undergo a legal verification process, including a title review, to ensure they are free of liens or encumbrances.','{\"answer_en\": \"Properties are secured through title insurance and registered in the Land Registry...\", \"answer_es\": \"Las propiedades estn aseguradas mediante seguros de ttulo y registradas en el Registro de Tierras...\", \"question_en\": \"How is the property I\'m buying secured?\", \"question_es\": \"Cmo est asegurada la propiedad que estoy comprando?\"}',1,'2024-12-20 19:26:21','2024-12-20 19:26:21',NULL),(5,'Can I finance the purchase of a property?','Yes, you can finance your purchase through a local bank or direct financing options offered by some developers.','{\"answer_en\": \"Yes, many banks offer financing options for both locals and foreigners...\", \"answer_es\": \"S, muchos bancos ofrecen opciones de financiamiento para locales y extranjeros...\", \"question_en\": \"Can I finance the purchase of a property?\", \"question_es\": \"Puedo financiar la compra de una propiedad?\"}',1,'2024-12-20 19:29:13','2024-12-20 19:29:13',NULL),(6,'What are the benefits of investing in real estate in the Dominican Republic?','The country offers high appreciation rates in tourist areas, tax benefits under the CONFOTUR Law, and opportunities to generate income through vacation rentals.','{\"answer_en\": \"Benefits include strong rental income potential, tax incentives, and stable property appreciation...\", \"answer_es\": \"Los beneficios incluyen potencial de ingresos de alquiler fuerte, incentivos fiscales y apreciacin de propiedades estable...\", \"question_en\": \"What are the benefits of investing in real estate in the Dominican Republic?\", \"question_es\": \"Cules son los beneficios de invertir en bienes races en la Repblica Dominicana?\"}',1,'2024-12-20 19:30:26','2024-12-20 19:30:26',NULL),(7,'What does the price of an off-plan property include?','The price typically includes the land, construction, finishes, common areas, and project amenities. Additional features like pools or terraces may have extra costs.','{\"answer_en\": \"Off-plan prices typically include the land, construction, and finishing costs...\", \"answer_es\": \"Los precios en planos tpicamente incluyen el terreno, construccin y costos de acabado...\", \"question_en\": \"What does the price of an off-plan property include?\", \"question_es\": \"Qu incluye el precio de una propiedad en planos?\"}',1,'2024-12-20 19:30:59','2024-12-20 19:30:59',NULL),(8,'What is a presale agreement?','Its a contract signed before the property is fully built, securing the price and conditions of the property while the development is completed.','{\"answer_en\": \"A presale agreement is a binding contract between buyer and developer for off-plan properties...\", \"answer_es\": \"Un acuerdo de preventa es un contrato vinculante entre comprador y desarrollador para propiedades en planos...\", \"question_en\": \"What is a presale agreement?\", \"question_es\": \"Qu es un acuerdo de preventa?\"}',1,'2024-12-20 19:31:53','2024-12-20 19:31:53',NULL),(9,'How can I generate income from my property?','Properties in tourist areas are ideal for vacation rentals through platforms like Airbnb or for long-term rentals.','{\"answer_en\": \"You can generate income through short-term rentals, long-term leasing, or property management services...\", \"answer_es\": \"Puede generar ingresos a travs de alquileres a corto plazo, arrendamientos a largo plazo, o servicios de administracin de propiedades...\", \"question_en\": \"How can I generate income from my property?\", \"question_es\": \"Cmo puedo generar ingresos de mi propiedad?\"}',1,'2024-12-20 19:32:36','2024-12-20 19:32:36',NULL),(10,'What is the process for registering a property?','Once the purchase is completed, the property title must be registered under the buyer\'s name at the Land Registry. This process is handled by a lawyer or real estate manager.','{\"answer_en\": \"The registration process involves title verification, payment of fees, and recording with the Land Registry...\", \"answer_es\": \"El proceso de registro implica verificacin de ttulo, pago de tarifas, y registro en el Registro de Tierras...\", \"question_en\": \"What is the process for registering a property?\", \"question_es\": \"Cul es el proceso para registrar una propiedad?\"}',1,'2024-12-20 19:33:34','2024-12-20 19:33:34',NULL),(11,'What happens if the property I purchase is part of a tourist development?','Tourist developments may offer tax benefits under the CONFOTUR Law, such as exemptions from transfer and property taxes for several years.','{\"answer_en\": \"Tourist developments have special regulations and may offer additional benefits and tax incentives...\", \"answer_es\": \"Los desarrollos tursticos tienen regulaciones especiales y pueden ofrecer beneficios adicionales e incentivos fiscales...\", \"question_en\": \"What happens if the property I purchase is part of a tourist development?\", \"question_es\": \"Qu sucede si la propiedad que compro es parte de un desarrollo turstico?\"}',1,'2024-12-20 19:34:20','2024-12-20 19:34:20',NULL),(12,'What is the CONFOTUR Law?','The CONFOTUR Law (Law 158-01) is a Dominican Republic regulation that offers tax incentives to promote tourism-related projects. It exempts buyers from property transfer tax (3%), annual property tax (IPI), and other municipal taxes for up to 10 years, making it highly attractive for investors in tourist areas like Punta Cana and Bvaro.\r\n\r\nIf you have questions or need guidance on CONFOTUR-approved properties, feel free to contact us!','{\"answer_en\": \"CONFOTUR Law provides tax exemptions and benefits for tourism-related investments in the Dominican Republic...\", \"answer_es\": \"La Ley CONFOTUR proporciona exenciones fiscales y beneficios para inversiones relacionadas con turismo en la Repblica Dominicana...\", \"question_en\": \"What is the CONFOTUR Law?\", \"question_es\": \"Qu es la Ley CONFOTUR?\"}',1,'2024-12-20 19:37:37','2024-12-20 19:37:37',NULL),(13,'How long does it take to close a real estate transaction?','The closing process typically takes 30 to 90 days, depending on legal verification and financial arrangements.','{\"answer_en\": \"Typically, a real estate transaction takes 2-4 months depending on financing and documentation...\", \"answer_es\": \"Tpicamente, una transaccin de bienes races toma 2-4 meses dependiendo de financiamiento y documentacin...\", \"question_en\": \"How long does it take to close a real estate transaction?\", \"question_es\": \"Cunto tiempo tarda en cerrarse una transaccin de bienes races?\"}',1,'2024-12-20 19:45:35','2024-12-20 19:45:35',NULL),(14,'Do I need to hire a lawyer to buy a property?','While not mandatory, it is highly recommended to hire a lawyer to review contracts and ensure a secure process.','{\"answer_en\": \"While not required by law, hiring a lawyer is strongly recommended to protect your interests...\", \"answer_es\": \"Aunque no es requerido por ley, se recomienda encarecidamente contratar un abogado para proteger sus intereses...\", \"question_en\": \"Do I need to hire a lawyer to buy a property?\", \"question_es\": \"Necesito contratar un abogado para comprar una propiedad?\"}',1,'2024-12-20 19:47:30','2024-12-20 19:47:30',NULL);
/*!40000 ALTER TABLE `faqs` ENABLE KEYS */;
UNLOCK TABLES;

