INSERT INTO `seo_settings` VALUES (2,'all-categories','1734549228.7162.svg','Discover a World of Possibilities: Explore Our Diverse Real Estate Categories','Embark on a journey through our extensive real estate categories, where every property tells a unique story. Find your dream home, investment opportunity, or perfect living space. Elevate your lifestyle with our curated selection of premium properties.','All-Inclusive Real Estate, Comprehensive Property Listings, Diverse Homes for Sale, Curated Investment Opportunities, Premium Residential Spaces, Versatile Real Estate Categories, Tailored Property Selection, Unique Homes and Estates, Exclusive Property Offerings, Explore Your Dream Home','2024-12-18 19:13:48','2024-12-18 19:13:48'),(3,'homepage','1734549460.3896.svg','Omko Real Estate | Expert Property Investments in the Dominican Republic','Discover expert property investment opportunities in the Dominican Republic with Omko Real Estate. Buy, rent, or invest in top-quality properties tailored to your needs. Let us help you make the best investment today!','Omko Real Estate, property investments Dominican Republic, real estate RD, real estate agency, buy property Dominican Republic, rent apartments RD, investment opportunities, property listings, houses for sale RD, real estate solutions.','2024-12-18 19:17:40','2024-12-18 19:17:40'),(4,'about-us','1734549613.681.svg','Unveiling Our Story: Crafting Excellence in Real Estate Experiences','Discover the heart behind our real estate commitment. Journey through our values, expertise, and passion that drive us to redefine the art of property transactions. Join us in creating your next chapter in extraordinary living','Real Estate Commitment, Our Story in Property, Crafting Excellence, Passion for Real Estate, Values in Realty, Expertise in Property Transactions, Redefining Real Estate Experiences, Creating Extraordinary Living, About Us in Real Estate, Next Chapter in Property','2024-12-18 19:20:13','2024-12-18 19:20:13'),(5,'articles','1734625781.8936.svg','Insights and Inspiration: Navigating the Real Estate Landscape with Expert Articles','Delve into a wealth of real estate knowledge. Our expert articles offer insights, trends, and inspiration to guide you through property decisions. Elevate your understanding and make informed choices in your real estate journey.','Real Estate Insights,\r\nExpert Property Articles,\r\nInformed Property Decisions,\r\nReal Estate Trends,\r\nProperty Investment Guidance,\r\nLatest in Realty,\r\nInspirational Real Estate Reads,\r\nPro Tips for Homebuyers,\r\nNavigating Property Markets,\r\nExpert Insights for Sellers','2024-12-19 16:29:41','2024-12-19 16:29:41'),(6,'chat','1734632098.3959.svg','Live Chat for Real Estate | Expert Assistance by Omko Real Estate','Connect instantly with Omko Real Estate\'s expert agents. Get seamless property assistance, real-time answers, and personalized support for all your real estate needs. Let\'s chat now!','Real Estate Chat, Property Assistance, Omko Real Estate, Live Chat Support, Instant Property Help, Real-Time Agent Communication, Real Estate Inquiries, Property Questions Answered, Quick Real Estate Conversations, Real Estate Help Online','2024-12-19 18:14:58','2024-12-19 18:14:58'),(7,'contact-us','1734632440.7549.svg','Contact Omko Real Estate | Your Property Experts Are Here','Reach out to Omko Real Estate for all your property needs. Our team is ready to assist with buying, selling, or renting. Contact us today for expert real estate.','Contact Omko Real Estate, Dominican Republic Properties, Real Estate Punta Cana, Property Assistance RD, Real Estate Experts RD, Buy Rent Sell Properties DR, Real Estate in Santo Domingo, Contact Property Agents Dominican Republic','2024-12-19 18:20:40','2024-12-19 18:20:40'),(8,'featured-properties','1734632652.9389.svg','Featured Properties in Dominican Republic | Omko Real Estate','Explore exclusive featured properties with Omko Real Estate. Find your dream home, luxury villa, or investment property in top locations like Punta Cana .','Featured Properties Dominican Republic, Luxury Real Estate RD, Omko Real Estate, Punta Cana Properties, Santo Domingo Real Estate, Investment Properties RD, Exclusive Properties Dominican Republic, Buy Sell Rent RD, Real Estate Listings RD','2024-12-19 18:24:12','2024-12-19 18:24:12'),(9,'properties-on-map','1734632804.4766.svg','Properties on Map | Explore Real Estate in Dominican Republic','Find properties easily with Omko Real Estate\'s interactive map. Discover homes, villas, and investment opportunities across Punta Cana,  Dominican Republic.','Properties on Map Dominican Republic, Real Estate Map RD, Omko Real Estate Map, Explore Properties RD, Punta Cana Properties Map, Santo Domingo Real Estate, Map-Based Property Search RD, Homes for Sale Map RD, Villas on Map Dominican Republic','2024-12-19 18:26:44','2024-12-19 18:26:44'),(10,'most-viewed-properties','1734632972.0725.svg','Most Viewed Properties in DR | Omko Real Estate','Discover the most viewed and sought-after properties with Omko Real Estate. Explore the top homes, villas, and investment opportunities in Pc Santo Domingo.','Most Viewed Properties Dominican Republic, Top Real Estate RD, Omko Real Estate, Popular Properties Punta Cana, Most Popular Properties RD, Best Real Estate Listings Dominican Republic, Luxury Properties RD, Investment Properties Punta Cana, Most In-Demand Properties Santo Domingo','2024-12-19 18:29:32','2024-12-19 18:29:32'),(11,'most-favorite-properties','1734633233.6156.svg','Favorite Properties in Dominican Republic | Omko Real Estate','Explore the favorite and highly rated properties with Omko Real Estate. Find your ideal home, villa, or investment opportunity in the Dominican Republics top.','Most Favorite Properties Dominican Republic, Favorite Properties RD, Omko Real Estate, Popular Homes Punta Cana, Best Rated Properties RD, Top Villas Santo Domingo, Luxury Properties Dominican Republic, Favorite Real Estate Listings RD, Top Real Estate Investments RD\r\n\r\nEste enfoque destaca las propiedades ms queridas por los usuarios, lo que puede generar confianza y atraer a compradores interesados en opciones populares y de calidad.','2024-12-19 18:33:53','2024-12-19 18:33:53'),(12,'privacy-policy','1734633690.4063.svg','Privacy Policy | Omko Real Estate','Read Omko Real Estate\'s Privacy Policy. Learn how we protect your personal information and ensure a secure browsing experience for all real estate inquiries and services.','Privacy Policy Omko Real Estate, Data Protection Dominican Republic, Real Estate Privacy Policy, Secure Real Estate Transactions, Personal Data Protection RD, User Privacy Real Estate, Privacy Statement Omko, Confidentiality in Real Estate RD, Privacy Policy Dominican Republic','2024-12-19 18:41:30','2024-12-19 18:41:30'),(13,'all-properties','1734634421.5167.svg','All Properties for Sale in Dominican Republic | Omko Real Estate','Browse all available properties with Omko Real Estate. Find homes, villas, apartments, and investment opportunities in top locations across the Dominican Republic.','All Properties Dominican Republic, Omko Real Estate Listings, Real Estate for Sale RD, Punta Cana Properties, Santo Domingo Homes, Villas for Sale Dominican Republic, Apartments in RD, Investment Properties Dominican Republic, Real Estate Listings RD, Buy Real Estate RD','2024-12-19 18:53:41','2024-12-19 18:53:41'),(14,'properties-nearby-city','1734634535.6723.svg','Properties Near Your City in Dominican Republic | Omko Real Estate','Discover properties near your city with Omko Real Estate. Explore homes, villas, and apartments close to top locations like Punta Cana, Santo Domingo, and more','Properties Near City Dominican Republic, Homes for Sale Near City RD, Omko Real Estate Nearby, Villas Near Santo Domingo, Properties Near Punta Cana, Apartments Nearby RD, Real Estate Near Major Cities RD, Local Real Estate Listings Dominican Republic','2024-12-19 18:55:35','2024-12-19 18:55:35'),(15,'search','1734634636.7452.svg','Search Properties in Dominican Republic | Omko Real Estate','Search for homes, villas, apartments, and investment properties in the Dominican Republic with Omko Real Estate. Find your dream property in top locations like Punta Cana and Santo Domingo.','Search Properties Dominican Republic, Real Estate Search RD, Omko Real Estate Search, Find Homes Punta Cana, Property Listings Santo Domingo, Villas for Sale RD, Apartments in Dominican Republic, Real Estate Search Dominican Republic, Properties for Sale RD','2024-12-19 18:57:16','2024-12-19 18:57:16'),(16,'subscription-plan','1734634772.5978.svg','Subscription Plan for Real Estate Services | Omko Real Estate','Explore Omko Real Estate\'s subscription plans for exclusive access to listings, updates, and personalized services. Stay ahead with the best real estate opportunities in the Dominican Republic.','Real Estate Subscription Plan RD, Omko Real Estate Plans, Subscription for Property Updates, Exclusive Listings Dominican Republic, Property Alerts Punta Cana, Real Estate Services Subscription, Personalized Real Estate Services RD, Omko Real Estate Subscription','2024-12-19 18:59:32','2024-12-19 18:59:32'),(17,'terms-and-condition','1734634888.5357.svg','Terms and Conditions | Omko Real Estate','Read the terms and conditions for using Omko Real Estate\'s services. Understand our policies on property listings, transactions, and user agreements in the Dominican Republic.','Terms and Conditions Omko Real Estate, Real Estate Terms Dominican Republic, Property Service Agreement RD, Omko Real Estate Policies, Real Estate Transactions Terms, Legal Terms Omko Real Estate, User Agreement Dominican Republic, Property Listings Terms RD','2024-12-19 19:01:28','2024-12-19 19:01:28'),(18,'profile','1734634961.6808.svg','Your Profile | Omko Real Estate','Manage your profile with Omko Real Estate. Update your information, preferences, and track your property searches and transactions in the Dominican Republic.','User Profile Omko Real Estate, Real Estate Profile RD, Omko Profile Management, Real Estate Dashboard Dominican Republic, Property Preferences RD, Track Property Searches RD, Manage Real Estate Profile, Omko Real Estate Account','2024-12-19 19:02:41','2024-12-19 19:02:41'),(19,'user-register','1734635041.5483.svg','Register for Omko Real Estate | Create Your Account','Register with Omko Real Estate to access the best properties, receive updates, and manage your real estate inquiries and transactions in the Dominican Republic.','User Registration Omko Real Estate, Sign Up Real Estate RD, Create Account Omko Real Estate, Real Estate Account Dominican Republic, Register for Property Updates, Omko Real Estate Services Registration, Property Alerts Registration RD','2024-12-19 19:04:01','2024-12-19 19:04:01'),(20,'all-agents','1734635378.6407.svg','Meet All Agents | Omko Real Estate','Browse our team of expert real estate agents at Omko Real Estate. Connect with the best professionals in the Dominican Republic for all your property needs.','Real Estate Agents Omko, All Agents Dominican Republic, Omko Real Estate Team, Property Experts RD, Top Real Estate Agents Punta Cana, Agents for Sale RD, Real Estate Professionals Dominican Republic, Contact Omko Real Estate Agents, Property Specialists RD','2024-12-19 19:09:38','2024-12-19 19:09:38'),(21,'agent-details','1734635803.5588.svg','Meet All Agents | Omko Real Estate','Browse our team of expert real estate agents at Omko Real Estate. Connect with the best professionals in the Dominican Republic for all your property needs.','Real Estate Agents Omko, All Agents Dominican Republic, Omko Real Estate Team, Property Experts RD, Top Real Estate Agents Punta Cana, Agents for Sale RD, Real Estate Professionals Dominican Republic, Contact Omko Real Estate Agents, Property Specialists RD','2024-12-19 19:16:43','2024-12-19 19:16:43'),(22,'faqs','1734636255.8295.svg','Meet All Agents | Omko